export function MemoryResource() {
    return <div>
        <h2>Memory Resource</h2>
        <p>In computing, memory is a temporary storage area for data and instructions that the CPU processes. It's also known as RAM (random access memory). Memory is volatile, meaning that data is lost when the computer is turned off.</p>
    </div>
}
